window.bookSummaryJSON = "<p>Murder, torture, and vengeance collide to threaten the highest echelons of power. </p> <p>Evil is not born of madness, but madness of evil. Follow a rogue CIA agent who uncovers a shocking conspiracy deep in the intelligence community. But a shadow follows the investigation: a killer bent on a revenge so terrible, it is only matched by the crimes committed against him. In the end, no one escapes unscathed, no beliefs will go unchallenged, and no wrong will escape the terrible, final, and extraordinary retribution. </p>"; 
